import { Component } from '@angular/core';
import { ActivatedRoute, Router } from '@angular/router';
import { EmployeeService } from 'src/app/core/services/employee.service';
import { PresenceService } from 'src/app/core/services/presence.service';

@Component({
  selector: 'app-presence-form',
  templateUrl: './presence-form.component.html',
  styleUrls: ['./presence-form.component.css']
})
export class PresenceFormComponent {

  presence = {
    employeeId: '',
    date: '',
    checkInTime: '',
    checkOutTime: ''
  };

  employees: any[] = [];
  isEditMode: boolean = false;
  presenceId: string | null = null;

  constructor(
    private presenceService: PresenceService,
    private employeeService: EmployeeService,
    private router: Router,
    private route: ActivatedRoute
  ) {}

  ngOnInit(): void {
    this.loadEmployees();

    this.presenceId = this.route.snapshot.paramMap.get('id');
    this.isEditMode = !!this.presenceId;

    if (this.isEditMode && this.presenceId) {
      this.presenceService.getPresenceById(this.presenceId).subscribe({
        next: (data) => this.presence = data,
        error: (err) => console.error('Erreur chargement présence:', err)
      });
    }
  }

  loadEmployees() {
    this.employeeService.getAllEmployees().subscribe({
      next: (data) => this.employees = data,
      error: (err) => console.error(err)
    });
  }

  onSubmit(): void {
    if (this.isEditMode && this.presenceId) {
      this.presenceService.updatePresence(this.presenceId, this.presence).subscribe({
        next: () => this.router.navigate(['/admin/attendances']),
        error: (err) => console.error('Erreur MAJ présence', err)
      });
    } else {
      this.presenceService.addPresence(this.presence).subscribe({
        next: () => this.router.navigate(['/admin/attendances']),
        error: (err) => console.error('Erreur ajout présence', err)
      });
    }
  }

  goBack(): void {
    this.router.navigate(['/admin/attendances']);
  }
}
